Cloisters at 863 Hay is a striking piece of modern architecture, distinctly recognisable among the neighboring buildings along Hay Streetâ€™s facade.

The 5.5 Star Green Star 'A' Grade office tower comprises of nine levels of modern, energy efficient, technology driven work space offering large efficient floor plates in the surrounds of the oils and gas sector in the West End of the Perth CBD.  The mid-rise tower offers flexible fit-out opportunities across its 10,000 sqm of office space.

The tower sits above an enhanced retail arcade, with quality retail, food and beverage outlets. Its arcade is one of the CBDâ€™s busiest thoroughfares, joining St Georges Terrace and Hay Street through to Shafto Lane, another of Perth's bustling entertainment precincts. Instantly recognisable from close and afar by its enhanced media screens facing the busy Hay Street vista, the complex adds warmth and ambience to the CBD's West End.

Cloisters arcade boasts some of Perth's best casual dining experiences. Its sheltered courtyard with expansive retractable glass rooftop provides an inviting and sophisticated urban space for tenants to enjoy a meal, coffee or have a business meeting year-round.


The West End Tower has a number of modern amenities including:

- Stunning ground floor Lobby entry statement;
- Contemporary treatments to all common area lobbies including bathroom and shower facilities;
- Executive standard End-of-Trip amenity including secure bicycle room, lockers, change rooms with showers, ironing facilities, blow-dryers, drying room, TVâ€™s and daily towels service in the EOT;
- Secure underground car parking with ample competitively priced public bays;
- Generous tenant parking allocation and flexibility to provide additional tenant bays as required;
- Easy access to freeway, transit routes and public transport options, with Cat Bus stops at the building entrance;
- Bright ground floor arcade with connectivity to Hay Street;
- Destination food and retail hub with expansive communal urban space;
- 5 star NABERS Energy Rating;
- Extensive Metering to track and maximise energy-saving initiatives;
- Flexible floor plates offering open plan with an abundance of natural light;
- Generous market aligned incentives on offer
- On site Management team

